import React, { Component } from 'react';
import Car from "./Car/Car";
class App extends Component {

  state = {
    cars: [
      {name: 'Ford', year: 2018},
      {name: 'Audi', year: 2012},
      {name: 'BMW', year: 2020},
    ],
    pageTitle: 'My cars'
  };



  render() {
    return (
        <div className="App">
          <h2></h2>
          {
            this.state.cars.map((car, index) => {
              return (
                  <Car name={car.name} year={car.year} key={index} />
              );
            })
          }
        </div>
    )
  }
}

export default App;
